            <p class="text-center mx-4 my-4  bg-white p-12 font-hammer text-base">lorem ipsum dolor sit amet, consectetur adip</p>
            <p class="text-center mx-4 my-4  bg-white p-12 font-hammer text-base">lorem ipsum dolor sit amet, consectetur adip</p>
            <p class="text-center mx-4 my-4  bg-white p-12 font-hammer text-base">lorem ipsum dolor sit amet, consectetur adip</p>
            <p class="text-center mx-4 my-4  bg-white p-12 font-hammer text-base">lorem ipsum dolor sit amet, consectetur adip</p>
            <p class="text-center  mx-4 my-4 bg-white p-12 font-hammer text-base">lorem ipsum dolor sit amet, consectetur adip</p>
        </div>
    </div>
  );
}

export default App;
